import React from 'react';
import { Breadcrumb, BreadcrumbItem } from 'react-bootstrap';
import { Link, useParams } from 'react-router-dom';

const Breadcrumbs = () => {
    const params = useParams();
    console.log(`params: ${params}`);

    return (
        <Breadcrumb>
                <BreadcrumbItem>
                    <Link to='/' className='home-nav-link'><h3>Home</h3></Link>
                </BreadcrumbItem>
                <BreadcrumbItem className="home-nav-link">
                <Link to='/about' className='home-nav-link'><h3>About Me</h3></Link>
                </BreadcrumbItem>
                <BreadcrumbItem as={Link} to='/portfolio' className="home-nav-link">
                    <h3>My Work</h3>
                </BreadcrumbItem>
                <BreadcrumbItem as={Link} to='/contact' className="home-nav-link">
                    <h3>Contact</h3>
                </BreadcrumbItem>
        </Breadcrumb>
    )
};

export default Breadcrumbs;
